window.onload = function () {
    // c.style.visibility="hidden";
    var gameConfig = {
        type: Phaser.AUTO,
        parent:'c',
        width: 512,
        height: 800,
        backgroundColor: 0x000000,
        scene: [playGame,seduce,hide]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],
            addFlag = false;

        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        this.choose()

        this.resize();
        window.addEventListener("resize", this.resize, false);
    }

    choose(){
        var bg = this.add.image(0,0,'background').setOrigin(0,0)
        var title = this.add.image(256,300,'choose').setScale(0.9,0.9)
        var hide = this.add.image(256,550,'hide2').setScale(0.8,0.8).setInteractive().on('pointerdown',function () {
            this.showEnd('hide')
        },this)
        var seduce= this.add.image(256,650,'seduce2').setScale(0.8,0.8).setInteractive().on('pointerdown',function () {
            this.showEnd('seduce')
        },this)    
        this.tweens.add({
            targets: hide,
            props: {
                scaleX: { value: 1 },
                scaleY: { value: 1 },
            },
            duration: 400,
            // ease: 'Power1',
            yoyo: true,
            repeat: -1
        });
        this.tweens.add({
            targets: seduce,
            delay:400,
            props: {
                scaleX: { value: 1 },
                scaleY: { value: 1 },
            },
            duration: 400,
            // ease: 'Power1',
            yoyo: true,
            repeat: -1,
        });
    }
    showEnd(sce) {
        var left = this.add.image(-256, 400, 'bg1_h').setDepth(30)
        left.setTint(0x000000)
        var right = this.add.image(768, 400, 'bg1_h').setDepth(30)
        right.setTint(0x000000)
        this.tweens.add({
            targets: [left],
            x: 0,
            duration: 200
        })
        this.tweens.add({
            targets: [right],
            x: 512,
            duration: 200,
            onComplete: () => {
                this.scene.start(sce)
            }
        })
    }
    showStart() {
        var left = this.add.image(0, 400, 'bg1_h').setDepth(30)
        left.setTint(0x000000)
        var right = this.add.image(512, 400, 'bg1_h').setDepth(30)
        right.setTint(0x000000)
        this.tweens.add({
            targets: [left],
            x: -256,
            duration: 200
        })
        this.tweens.add({
            targets: [right],
            x: 768,
            duration: 200
        })
    }
    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
            v.style.width = windowWidth + "px";
            v.style.height = (windowWidth / gameRatio) + "px";
            c.style.width = windowWidth + "px";
            c.style.height = (windowWidth / gameRatio) + "px";
        }
        else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
            v.style.width = (windowHeight * gameRatio) + "px";
            v.style.height = windowHeight + "px";
            c.style.width = (windowHeight * gameRatio) + "px";
            c.style.height = windowHeight + "px";
        }
    }
}
